<style>
    :root {
        color: #FFFFFF
    }

    footer {
        position: relative;
        width: 100%;
        margin-top: 1rem;
        height: 100%;
        color: #FFFFFF;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
    }

    footer .footer-bg {
        position: absolute;
        top: 0;
        z-index: -1 !important;
        width: 100%;
        height: 600px;
        object-fit: cover;
    }

    footer .footer-content {
        width: 100%;
        display: grid;
        grid-template-columns: 2fr 2.5fr 4fr 5fr;
        gap: 1.5rem;
        padding-left: 3rem;
        padding-right: 3rem;
        font-size: 16px !important;
        margin-top: 7rem;
    }

    footer .footer-content .footer-navigate {
        text-align: end;
        width: 100%;
    }

    footer .footer-content .footer-navigate h5 {
        font-weight: bolder;
        font-size: 16px !important;
    }

    footer .footer-content .footer-navigate li {
        list-style: none;
    }


    footer .footer-content .footer-navigate li a {
        color: #FFFFFF;
        text-decoration: none;
        transition: all 0.5s ease;
        font-size: 16px !important;
    }

    footer .footer-content .footer-navigate li:hover a {
        background-color: #0F963A;

    }


    footer .footer-content .footer-address {
        text-align: end;
        width: 100%;
    }

    footer .footer-content .footer-address li {
        list-style: none;
        font-size: 16px !important;
    }


    footer .footer-content .footer-address h5 {
        font-size: 16px !important;
        font-weight: bolder;
    }

    footer .footer-content .footer-address li {
        font-size: 16px !important;
    }

    footer .footer-content .footer-address li h5 {
        font-size: 16px !important;
    }

    footer .footer-content .footer-social {
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        width: 100%;
    }

    footer .footer-content .footer-social img {
        width: 250px;
        max-width: auto;
    }

    footer .footer-content .footer-social h5 {
        text-align: center;
        font-weight: bold;
        margin-top: 2rem;
        margin-bottom: 1rem;
        font-size: 16px;
    }


    footer .footer-content .footer-social .link-social {
        display: flex;
        gap: 2rem;
        padding-left: 3rem;
        padding-right: 3rem;
    }

    footer .footer-content .footer-company .company-bg {
        width: 100%
    }

    footer .footer-content .footer-company h5 {
        font-weight: bold;
        font-size: 16px;

    }

    footer .footer-content .footer-company .company-bg {
        width: 360px;
        max-width: 100%;
        height: 240px;
        max-height: 100%;
        background-color: #D9D9D9;

    }

    @media screen and (max-width: 1220px) {
        footer {
            font-size: 14px !important;
        }

        footer .footer-bg {
            position: absolute;
            top: 0;
            z-index: -1 !important;
            width: 100%;
            height: 650px;
            object-fit: cover;
        }

        footer .footer-content {
            width: 100%;
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 2rem;
            padding-left: 1rem;
            padding-right: 1rem;
            margin-top: 1rem;
        }

        footer .footer-content .footer-navigate {
            text-align: center;
            width: 100%;
        }


        footer .footer-content .footer-address {
            text-align: start;
            width: 100%;
        }
    }

    @media screen and (max-width: 1024px) {
        footer .footer-bg {
            position: absolute;
            top: 0;
            z-index: -1 !important;
            width: 100%;
            height: 700px;
            object-fit: cover;
        }
    }


    @media screen and (max-width:789px) {
        footer {
            font-size: 14px !important;
            background-color: #0F963A;
            padding-top: 1rem;
        }


        footer .footer-content {
            width: 100%;
            display: grid;
            grid-template-columns: 100%;
            gap: 1rem;
            padding-left: 1rem;
            padding-right: 1rem;
            padding-bottom: 1rem;

        }


        footer .footer-content .footer-navigate {
            text-align: start;
        }

        footer .footer-content .footer-address {
            text-align: start;
        }
    }

    .footer-social-display {
        display: none !important;
    }

    @media screen and (max-width: 769px) {
        .footer-social-display {
            display: flex !important;
        }

        .footer-social {
            order: 1;
        }

        .footer-navigate {
            order: 2
        }

        .footer-address {
            order: 3;
        }

        .footer-company {
            order: 4
        }
    }

    @media screen and (max-width: 1221px) {
        footer .footer-bg {
            height: 100%;
        }
    }


    @media screen and (max-width: 1025px) {
        footer .footer-bg {
            height: 700px !important;
        }

        footer .footer-content .footer-navigate h5 {
            font-weight: bolder;
            font-size: 14px !important;
        }

        footer .footer-content .footer-navigate li a {
            list-style: none;
            font-size: 14px !important;
        }

        footer .footer-content .footer-address h5 {
            font-size: 14px !important;
            font-weight: bolder;
        }

        footer .footer-content .footer-address li {
            font-size: 14px !important;
        }

        footer .footer-content .footer-address li h5 {
            font-size: 14px !important;
        }

        footer .footer-content .footer-company h5 {
            font-weight: bold;
            font-size: 14px;

        }

        footer .footer-content .footer-company p {
            font-size: 14px;

        }

    }
</style>

